import React from "react";

import {
  Nav,
  Navbar,
  Form,
  FormControl,
  Button,
  Container,
  Col,
  Row,
} from "react-bootstrap";

const footer = () => {
  return (
    <Navbar
      bg="dark"
      variant="dark"
      style={{ height: "400px" }}
      className="sticky-bottom"
    >
      <Container className="container-fluid">
        <Row className="mx-auto">
          <Col>
            <Row>
              <Col>Facebook</Col>
              <Col>Twitter</Col>
              <Col>Instagram</Col>
            </Row>
          </Col>
        </Row>
      </Container>
    </Navbar>
  );
};

export default footer;
